import React from "react";
import { BrowserRouter as Router, Routes } from "react-router-dom";
import { Header, Footer } from "./components/Layout";
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <Router>
    <Header />
    <div className="main-wrapper">
      <Routes>

      </Routes>
    </div>
    <Footer />
  </Router>
  );
}

export default App;
